css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document regexp(".*\.(t|T|c|C)(x|X|s|S)(t|T|s|S)"){
html > body:not([bgcolor]) > pre:only-child{
width:85% !important;
min-height:408px !important;
margin:10px auto !important;
padding:96px 50px 88px 50px !important;
font-size:16px !important;
font-family:  "Microsoft YaHei"  !important;
line-height:150% !important;
white-space:pre-wrap !important;
word-wrap:break-word !important;
border:5px solid #ccc !important;
border-radius:0px !important;
text-shadow:#222 0px 0px 0px!important;
box-shadow: 0 0px 2px #222 !important;
color:white !important;
background-color:#222 !important;
/*中下、尾、頭、右、下、左、上、線*/
background-image:url("data:image/png;base64,"),url("data:image/png;base64,"),url("data:image/png;base64,"),url("data:image/png;base64,"),url("data:image/png;base64,"),url("data:image/png;base64,"),url("data:image/png;base64,"),url("data:image/png;base64,") !important;
background-repeat:no-repeat,no-repeat,no-repeat,repeat-y,repeat-x,repeat-y,repeat-x,repeat !important;
background-origin:border-box,border-box,border-box,border-box,border-box,border-box,border-box,content-box !important;
background-position:center 100%,100% 100%,50px 66px,100% 0%,0% 100%,0% 0%,0% 0%,0% 0% !important;
}
html{
background:url("data:image/png;base64,") repeat scroll 0 0 #EAEFF2 !important;
}
}
